declare
    c_vt_fire_type   constant number := 100006363 /*V_FIRE_TYPE*/;

    v_size_acres     number;
    v_latitude       number;
    v_longitude      number;
    v_perc_contained number;
    v_type_id        number;

    v_description    varchar2(5000);
    v_type           varchar2(5000);
    v_report_date    varchar2(5000);
    v_exp_contain    varchar2(5000);


begin

    v_description := nvl(util.getvalstrbyid(:pk, 1000062855 /*F_DESCRIPTION*/), 'n/a');
    if v_description = 'n/a' then
        return;
    end if;

    v_size_acres := replace(regexp_substr(v_description, '\d+ acres'), 'acres');
    util.setvalnumbyid(:pk, 1000062866 /*F_SIZE*/, v_size_acres);

    v_latitude := regexp_substr(v_description, '\d+\.\d+');
    util.setvalnumbyid(:pk, 1000062852/*F_LATITUDE*/, v_latitude);

    v_longitude := regexp_substr(v_description, '-\d+\.\d+');
    util.setvalnumbyid(:pk, 1000062853/*F_LONGITUDE*/, v_longitude);

    v_perc_contained := replace(regexp_substr(v_description, '\d+%'), '%');
    util.setvalnumbyid(:pk, 1000062913/*F_PERCENT_CONTAINED*/, v_perc_contained);

    v_type := replace(regexp_substr(replace(substr(v_description, instr(v_description, 'Fire Type:')), 'Fire Type:'), '\s\w+'), ' ');

    begin
        select attrib_v_table_value_id
          into v_type_id
          from attrib_v_table_value
         where attrib_v_table_id = c_vt_fire_type
           and value = v_type;
    exception when no_data_found then
        insert into attrib_v_table_value(attrib_v_table_id, value, display, filterable) values (c_vt_fire_type, v_type, 1, 1)
        returning attrib_v_table_value_id into v_type_id;
    end;

    util.setvalnumbyid(:pk, 1000062867/*F_FIRE_TYPE*/, v_type_id, 1);

    v_report_date := regexp_substr(v_description, '\d+/\d+/\d+');
    if v_report_date is not null then
        util.setvaldatebyid(:pk, 1000062912/*F_REPORT_DATE*/, to_date(v_report_date, 'MM/DD/YYYY'));
        v_description := replace(v_description, v_report_date);
    end if;

    v_exp_contain := regexp_substr(v_description, '\d+/\d+/\d+');
    if v_exp_contain is not null then
        util.setvaldatebyid(:pk, 1000062914/*F_EXPECTED_CONTAINMENT*/, to_date(v_exp_contain, 'MM/DD/YYYY'));
    end if;

end;

